106 minuten

geregisseerd door Marc Forster
met Daniel Craig, Mathieu Amalric en Judi Dench

Na het verraad van Vesper Lynd moet James Bond (Daniel Craig) moeite 
doen om zijn gevoelens buiten zijn missie te houden. Samen met M 
(Judi Dench) ondervraagt hij Mr White (Jesper Christensen), wiens 
bekentenissen tot meer inzicht leiden wat betreft de complexe afperspraktijken 
waar Lynd mee te maken had. Een nieuwe ontdekking brengt Bond naar Haiti, 
waar hij de even mooie als mysterieuze Camille (Olga Kurylenko) ontmoet.
